["This image is a page from a Swiss law document titled "Loi sur l'énergie" (Law on Energy), abbreviated as LcEne. It was enacted on September 8, 2023, and will come into effect on January 1, 2025. The document is issued by the Grand Conseil du canton du Valais (Grand Council of the Canton of Valais).

The law is structured as follows:

### Context and Purpose:
The law is based on several federal and cantonal laws and regulations, including:
- Article 60, paragraph 2 of the Federal Energy Law of September 30, 2016 (LEne);
- Article 9 of the Federal Law on CO₂ Emissions Reduction of December 23, 2011 (CO₂ Law);
- Article 50, paragraph 1 of the Federal Energy Ordinance of November 1, 2017 (OEne);
- Articles 31, paragraph 1; 42, paragraph 1; 54; and 58 of the Cantonal Constitution;
- The Building Law of December 15, 2016 (LC).

The law is proposed by the State Council.

### Article 1: Generalities
#### Objectives
The law aims to contribute to a sufficient, diversified, secure, economic, indigenous, and environmentally respectful energy supply within the framework of sustainable development. Its specific objectives are:
a) To promote energy production and distribution through optimizing conditions;
b) To ensure the efficient use of energy;
c) To strengthen the use of renewable energy resources, particularly indigenous ones, such as heat rejection for electricity, heat, or other secondary energy agents."]
